import styled from 'styled-components'


export const HomeStyle = styled.div`

    .principal {
        aling-itens: center;
    }

    img {
        width: 100%;
        margin-top: 12px;
        height: 800px;
    }

    .sobreposicao {
        position: absolute;
        width: 100%;
        background: linear-gradient(0deg, rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5));
